const Pokemon = ({ pokemon }) => {

    const sprites = Object.keys(pokemon.sprites).forEach(key => {
        return [key, pokemon.sprites[key]]
    })

    console.log(sprites)

    return (
        <div>
            Pokemon
        </div>
    )
}

export default Pokemon
